export default class CarSelectionScreen extends Phaser.Scene {
    constructor() {
        super({ key: 'CarSelectionScreen' });
    }

    preload() {
        // Load car images for selection
        this.load.image('car1', 'assets/Cars/cars1.png');
        this.load.image('car2', 'assets/Cars/cars2.png');
        this.load.image('car3', 'assets/Cars/cars3.png');
        this.load.image('car4', 'assets/Cars/cars4.png');
        this.load.image('car7', 'assets/Cars/cars7.png');
        this.load.image('car8', 'assets/Cars/cars8.png');
        this.load.image('car9', 'assets/Cars/cars9.png');
    }

    create() {
        this.add.text(400, 100, 'Select Your Car', { fontSize: '32px', fill: '#fff' }).setOrigin(0.5);

        // Display each car and make them interactive
        let car1 = this.add.image(150, 300, 'car1').setScale(2).setInteractive();
        let car2 = this.add.image(250, 300, 'car2').setScale(2).setInteractive();
        let car3 = this.add.image(350, 300, 'car3').setScale(2).setInteractive();
        let car4 = this.add.image(450, 300, 'car4').setScale(2).setInteractive();
        let car7 = this.add.image(550, 300, 'car7').setScale(2).setInteractive();
        let car8 = this.add.image(650, 300, 'car8').setScale(2).setInteractive();
        let car9 = this.add.image(750, 300, 'car9').setScale(2).setInteractive();

        // Set up car selection interactions
        car1.on('pointerdown', () => this.startGame('car1'));
        car2.on('pointerdown', () => this.startGame('car2'));
        car3.on('pointerdown', () => this.startGame('car3'));
        car4.on('pointerdown', () => this.startGame('car4'));
        car7.on('pointerdown', () => this.startGame('car7'));
        car8.on('pointerdown', () => this.startGame('car8'));
        car9.on('pointerdown', () => this.startGame('car9'));
    }

    startGame(selectedCar) {
        localStorage.setItem('selectedCar', selectedCar);  // Store the selection
        this.scene.start('MainGameScene');
    }
}
